float relu(float x) {
    return x > 0 ? x : 0;
}

void softmax(float* x, int size) {
    float max = x[0];
    for (int i = 1; i < size; ++i) {
        if (x[i] > max) max = x[i];
    }
    float sum = 0;
    for (int i = 0; i < size; ++i) {
        x[i] = exp(x[i] - max);
        sum += x[i];
    }
    for (int i = 0; i < size; ++i) {
        x[i] /= sum;
    }
}

void dense1(float* input, float* output, float weights[INPUT_SIZE][LAYER1_SIZE], float* bias) {

    for (int i = 0; i < LAYER1_SIZE; ++i) {
        output[i] = bias[i];
        for (int j = 0; j < INPUT_SIZE; ++j) {
            output[i] += input[j] * weights[j][i];
        }
    }
}

void dense2(float* input, float* output, float weights[LAYER1_SIZE][LAYER2_SIZE], float* bias) {
    for (int i = 0; i < LAYER2_SIZE; ++i) {
        output[i] = bias[i];
        for (int j = 0; j < LAYER1_SIZE; ++j) {
            output[i] += input[j] * weights[j][i];
        }
    }
}

void dense3(float* input, float* output, float weights[LAYER2_SIZE][OUTPUT_SIZE], float* bias) {
    for (int i = 0; i < OUTPUT_SIZE; ++i) {
        output[i] = bias[i];
        for (int j = 0; j < LAYER2_SIZE; ++j) {
            output[i] += input[j] * weights[j][i];
        }
    }
}

